// Dependencies.
import React from 'react';

// Component 'AboutMe'.
function Projects() {
    return (
        // AboutMe Container.
        <>
            <div id="MyProjects">
                {/* Gradient Animated Jumbotron Container */}
                <div id="MyProjectsHeader" class="jumbotron text-center">
                    {/* 'My Projects' Context */}
                    <h1 class="card-title display-3"><strong>&lt; My Projects &gt;</strong></h1>
                    <p class="lead card-text">
                        This is a short preview of each of my six most proud projects from school, work, and personal.<br />
                        You can cycle through the list by tapping the small blue circles at the bottom of the project<br />
                        cards or by swiping left or right on the screen. If you want to view more of my work, please<br />
                        visit my Github or LinkedIn for more information.
                    </p>
                    {/* LinkedIn Profile */}
                    <a class="fa-lg p-4 m-2 li-ic hvr-grow"><i class="fab fa-linkedin-in text-white display-4"></i></a>
                    {/* Github Profile */}
                    <a class="fa-lg p-4 m-2 tw-ic hvr-grow"><i class="fab fa-github text-white display-4"></i></a>
                </div>
                <h1 className="text-white text-center display-4 mb-4">
                    <i class="fa fa-star" aria-hidden="true"></i> <i class="fa fa-star" aria-hidden="true"></i>  Projects <i class="fa fa-star" aria-hidden="true"></i> <i class="fa fa-star" aria-hidden="true"></i>
                </h1>
                <div className="row p-0 m-0">
                    {/* Project - 'GTM QuickShare' */}
                    <div class="card mx-auto project">
                        {/* <!-- Project Card --> */}
                        <img class="card-img-top" src="./assets/project-thumbnails/gtmQuickShare.png" alt="Card image cap" />
                        {/* <!-- Porject Content --> */}
                        <div class="card-body">
                            {/* <!-- Porject Name --> */}
                            <h4 class="card-title"><a>Card title</a></h4>
                            {/* <!-- Project Excerpt --> */}
                            <p class="card-text">Some quick example text to build on the card title and make up the bulk.</p>
                            {/* <!-- Link to Github & Live Project--> */}
                            <a href="#" class="btn btn-primary">Button</a>
                        </div>
                    </div>
                    {/* <!-- Card --> */}
                    <div class="card mx-auto project">
                        {/* <!-- Card image --> */}
                        <img class="card-img-top" src="./assets/project-thumbnails/scraper.png" alt="Card image cap" />
                        {/* <!-- Card content --> */}
                        <div class="card-body">
                            {/* <!-- Title --> */}
                            <h4 class="card-title"><a>Card title</a></h4>
                            {/* <!-- Text --> */}
                            <p class="card-text">Some quick example text to build on the card title and make up the bulk.</p>
                            {/* <!-- Button --> */}
                            <a href="#" class="btn btn-primary">Button</a>
                        </div>
                    </div>
                    {/* <!-- Card --> */}
                    <div class="card mx-auto project">
                        {/* <!-- Card image --> */}
                        <img class="card-img-top" src="./assets/project-thumbnails/LocoBounce.png" alt="Card image cap" />
                        {/* <!-- Card content --> */}
                        <div class="card-body">
                            {/* <!-- Title --> */}
                            <h4 class="card-title"><a>Card title</a></h4>
                            {/* <!-- Text --> */}
                            <p class="card-text">Some quick example text to build on the card title and make up the bulk.</p>
                            {/* <!-- Button --> */}
                            <a href="#" class="btn btn-primary">Button</a>
                        </div>
                    </div>
                    {/* <!-- Card --> */}
                    <div class="card mx-auto project">
                        {/* <!-- Card image --> */}
                        <img class="card-img-top" src="./assets/project-thumbnails/triviaGame.png" alt="Card image cap" />
                        {/* <!-- Card content --> */}
                        <div class="card-body">
                            {/* <!-- Title --> */}
                            <h4 class="card-title"><a>Card title</a></h4>
                            {/* <!-- Text --> */}
                            <p class="card-text">Some quick example text to build on the card title and make up the bulk.</p>
                            {/* <!-- Button --> */}
                            <a href="#" class="btn btn-primary">Button</a>
                        </div>
                    </div>
                    {/* <!-- Card --> */}
                    <div class="card mx-auto project">
                        {/* <!-- Card image --> */}
                        <img class="card-img-top" src="./assets/project-thumbnails/wordGuessGame.png" alt="Card image cap" />
                        {/* <!-- Card content --> */}
                        <div class="card-body">
                            {/* <!-- Title --> */}
                            <h4 class="card-title"><a>Card title</a></h4>
                            {/* <!-- Text --> */}
                            <p class="card-text">Some quick example text to build on the card title and make up the bulk.</p>
                            {/* <!-- Button --> */}
                            <a href="#" class="btn btn-primary">Button</a>
                        </div>
                    </div>
                    {/* <!-- Card --> */}
                    <div class="card mx-auto project">
                        {/* <!-- Card image --> */}
                        <img class="card-img-top" src="./assets/project-thumbnails/bamazonCLI.png" alt="Card image cap" />
                        {/* <!-- Card content --> */}
                        <div class="card-body">
                            {/* <!-- Title --> */}
                            <h4 class="card-title"><a>Card title</a></h4>
                            {/* <!-- Text --> */}
                            <p class="card-text">Some quick example text to build on the card title and make up the bulk.</p>
                            {/* <!-- Button --> */}
                            <a href="#" class="btn btn-primary">Button</a>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}
// Do export.
export default Projects;
